  true,\n\t\"url\": null,\n\t\"notes\": \"The Early Childhood Longitudinal Study,
  Kindergarten Class of 1998-99 (ECLS-K), is part of the Early Childhood Longitudinal
  Study (ECLS) program; program data is available since 1998-99 at <http://nces.ed.gov/ecls/dataproducts.asp>.
  ECLS-K (http://nces.ed.gov/ecls/kindergarten.asp) is a longitudinal study that collected
  information about children's early learning and development, transition into kindergarten,
  and progress through school. A nationally representative sample of kindergartners
  in the 1998-99 school year was selected and followed over time. The study was conducted
  using direct assessments of children in their schools, telephone interviews with
  parents, and self-administered questionnaires for teachers and school administrator.
  Key information available in ECLS-K includes information on children's cognitive,
  social, emotional, and physical development, children's home environment, home educational
  activities, school environment, classroom environment, classroom curriculum, teacher
  qualifications, and before- and after-school care.\",\n\t\"license_title\": \"Creative
